import React from 'react';

const Sidebar = ({ notes }) => {
  return (
    <div>
      <ul className="bg-black max-w-[300px] mt-20 p-5 rounded-2xl">
        {notes &&
          notes.map((note) => {
            return (
              <li>
                <h1 className="font-cairo text-xl bg-blue-900 p-2 my-2">{note.title}</h1>
              </li>
            );
          })}
      </ul>
    </div>
  );
};

export default Sidebar;
